import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';

const ResultPage = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const { results } = location.state || {};

  if (!results) {
    return (
      <div>
        <h2>No results found.</h2>
        <button onClick={() => navigate('/details')}>Start Over</button>
      </div>
    );
  }

  return (
    <div>
      <h2>Analysis Results</h2>
      <h3>Overall Alzheimer's Risk Score: {results.finalScore}%</h3>
      <p>This score is a weighted combination of the following factors:</p>
      <ul>
        <li>Cognitive Quiz Impairment: {results.quiz}%</li>
        <li>MRI Scan Analysis: {results.mri}%</li>
        <li>Voice Pattern Analysis: {results.voice}%</li>
      </ul>
      <p style={{ fontStyle: 'italic', fontSize: '14px' }}>
        <strong>Disclaimer:</strong> This is a demo application. The results are illustrative and should not be considered a medical diagnosis. Please consult a qualified healthcare professional.
      </p>
      <button onClick={() => navigate('/details')}>Run New Analysis</button>
    </div>
  );
};

export default ResultPage;
